INSERT INTO `learning_tasks` VALUES (5,3,'第一周：变量与数据类型','学习C++基础语法，掌握变量和数据类型的使用','本周学习了C++的基础语法，包括整型、浮点型、字符型等数据类型，以及变量的定义和使用。重点掌握：\n1. 各种数据类型的取值范围\n2. 变量的命名规则\n3. 类型转换','https://example.com/video/week1','2025-01-01 09:00:00','2025-01-07 23:59:59',1,'2025-10-22 11:03:39','2025-10-22 11:03:39'),(6,3,'第二周：运算符与表达式','学习各种运算符的使用和表达式的计算','本周学习了算术运算符、关系运算符、逻辑运算符等。重点掌握：\n1. 运算符的优先级\n2. 表达式的求值顺序\n3. 常见错误和陷阱','https://example.com/video/week2','2025-01-08 09:00:00','2025-01-14 23:59:59',2,'2025-10-22 11:03:39','2025-10-22 11:03:39'),(7,3,'第三周：选择结构','学习if语句和switch语句的使用','本周学习了条件判断和分支结构。重点掌握：\n1. if-else语句的使用\n2. 多重if的应用\n3. switch语句的使用场景','https://example.com/video/week3','2025-01-15 09:00:00','2025-01-21 23:59:59',3,'2025-10-22 11:03:39','2025-10-22 11:03:39'),(12,7,'重构后的第一周：字符串基础','学习字符串的基本操作','字符串是字符的序列。C++中使用string类。',NULL,'2024-03-01 00:00:00','2024-03-07 23:59:59',1,'2025-10-22 11:41:07','2025-10-22 11:41:07'),(13,7,'重构后的第二周：字符串进阶','字符串的高级操作和算法',NULL,NULL,'2024-03-08 00:00:00','2024-03-14 23:59:59',2,'2025-10-22 11:41:07','2025-10-22 11:41:07'),(17,9,'重构后的第一周：字符串基础','学习字符串的基本操作','字符串是字符的序列。C++中使用string类。',NULL,'2024-03-01 00:00:00','2024-03-07 23:59:59',1,'2025-10-22 11:42:01','2025-10-22 11:42:01'),(18,9,'重构后的第二周：字符串进阶','字符串的高级操作和算法',NULL,NULL,'2024-03-08 00:00:00','2024-03-14 23:59:59',2,'2025-10-22 11:42:01','2025-10-22 11:42:01'),(40,11,'第一周','矩阵专项','查看 https://invited-quark-252.notion.site/2966d5823dce80adb71dc89ea025f7ff?pvs=74',NULL,'2025-11-07 20:37:00','2025-11-15 23:00:00',1,'2025-11-08 22:05:34','2025-11-08 22:05:34'),(41,12,'测试任务','用于测试的任务',NULL,NULL,'2025-11-13 15:18:29','2025-11-20 15:18:29',1,'2025-11-13 15:18:28','2025-11-13 15:18:28'),(42,1,'第一周：变量与数据类型','学习C++的基础语法，掌握变量定义、基本数据类型（int、float、double、char）的使用。','本周学习了C++的基础语法，包括：\n1. 变量的定义和初始化\n2. 基本数据类型：整型(int)、浮点型(float/double)、字符型(char)\n3. 变量的命名规则\n4. 常见的输入输出操作',NULL,'2025-11-21 00:00:00','2025-11-28 00:00:00',1,'2025-11-14 10:49:00','2025-11-14 10:49:00'),(43,1,'第二周：运算符与表达式','学习算术运算符、关系运算符、逻辑运算符，理解表达式的求值规则。','本周学习了各种运算符：\n1. 算术运算符：+、-、*、/、%\n2. 关系运算符：>、<、>=、<=、==、!=\n3. 逻辑运算符：&&、||、!\n4. 运算符优先级和结合性',NULL,'2025-11-28 00:00:00','2025-12-05 00:00:00',2,'2025-11-14 10:49:00','2025-11-14 10:49:00'),(44,1,'第三周：流程控制-选择结构','掌握if语句、if-else语句、switch语句的使用，学会根据条件执行不同的代码。','本周学习了选择结构：\n1. if单分支语句\n2. if-else双分支语句\n3. if-else if多分支语句\n4. switch-case语句\n5. 条件表达式的嵌套',NULL,'2025-12-05 00:00:00','2025-12-12 00:00:00',3,'2025-11-14 10:49:00','2025-11-14 10:49:00'),(45,1,'第四周：流程控制-循环结构','掌握for循环、while循环、do-while循环，学会使用循环解决重复性问题。','本周学习了循环结构：\n1. for循环的基本用法\n2. while循环和do-while循环\n3. break和continue语句\n4. 循环嵌套\n5. 常见循环问题的解决方法',NULL,'2025-12-12 00:00:00','2025-12-19 00:00:00',4,'2025-11-14 10:49:00','2025-11-14 10:49:00'),(46,13,'1.原、反、补码练习',NULL,NULL,NULL,'2025-11-14 10:59:00','2025-11-24 10:59:00',1,'2025-11-14 11:02:15','2025-11-14 11:02:15'),(47,13,'2.进制转换练习',NULL,NULL,NULL,'2025-11-14 11:00:00','2025-11-24 11:00:00',2,'2025-11-14 11:02:15','2025-11-14 11:02:15'),(48,13,'3.位运算练习',NULL,NULL,NULL,'2025-11-14 11:01:00','2025-12-01 11:01:00',3,'2025-11-14 11:02:15','2025-11-14 11:02:15'),(49,14,'测试',NULL,NULL,NULL,'2025-10-01 11:08:00','2025-11-07 11:08:00',1,'2025-11-14 11:08:46','2025-11-14 11:08:46');
