--
-- Table structure for table `oj_problems`
--

DROP TABLE IF EXISTS `oj_problems`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `oj_problems` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '题目ID',
  `title` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '题目标题',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '题目描述',
  `input_format` text COLLATE utf8mb4_unicode_ci COMMENT '输入格式说明',
  `output_format` text COLLATE utf8mb4_unicode_ci COMMENT '输出格式说明',
  `data_range` text COLLATE utf8mb4_unicode_ci COMMENT '数据范围说明',
  `time_limit` int DEFAULT '1000' COMMENT '时间限制（毫秒）',
  `memory_limit` int DEFAULT '256' COMMENT '内存限制（MB）',
  `level` int NOT NULL COMMENT 'GESP级别 1-6',
  `publish_date` date DEFAULT NULL COMMENT '发布日期（年月日）',
  `total_submissions` int DEFAULT '0' COMMENT '总提交数',
  `accepted_submissions` int DEFAULT '0' COMMENT '通过提交数',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_level` (`level`),
  KEY `idx_publish_date` (`publish_date`)
) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='OJ题目表';
/*!40101 SET character_set_client = @saved_cs_client */;

